アトミック命令を使って初めに作ることになる、最も単純なロックである。 シングルコアではビジーウェイト (メモリの値が変わるまで読み続ける) は 他のスレッドにスイッチしてメモリが書き換えられるまで無駄に CPU 時間を消費するため 行儀の悪いスタイルと言われるが、マルチコアではビジーウェイト中も他のコアが動けるため、 ロック時間が十分短いならばコンテキストスイッチのコストがかからずむしろ 性能のよいロックとなる。 また、割り込みハンドラ同士または割り込みハンドラとスレッドコンテキストとの間の ロックとして使用可能である。 データ構造としては、ロック本体はメモリ上に 1 word 程度の整数を用意するだけで ロック1つを実現できる。 xv6 (RISC-V) での実装 // Mutual exclusion lock.
struct spinlock { uint locked; // Is the lock held? // For debugging: char *name; // Name of lock. struct cpu *cpu; // The cpu holding the lock.
}; まず、スピンロックを取得した状態で、解放前に自身のコアで割り込みが入り、 その割り込みハンドラでそのロックを取得しようとした場合、デッドロックして コアが割り込みハンドラ内で固まってしまう。 そのため初めにローカルコア割り込みを OFF にしている。 割り込みハンドラからロックしないならば、これは不要とも言える。 ただしタイマ割り込みからのプリエンプトは禁止すべきだろう。 オープンソースの OS の実装を見て回るのもよい。 次の __sync_lock_test_and_set() がアトミック命令で、ロックの本体である。 アセンブラで直接書くか、このように gcc 拡張を使って多少ハードウェア非依存っぽく 書くこともできる。 このようなコンパイラ拡張は、コンパイラへの並べ替え禁止効果を含んでいて便利である。 自力でやるときは asm volatile とか使う。多分。 test_and_set は名前と違って atomic_swap に近いらしい。 「メモリを読んで返す」のと「メモリに第二引数 (1) を書き込む」を同時に行い、 その途中状態を他のコアから観測されないようにする。 具体的にはメモリバスロックを行い、自分以外のコアのメモリアクセスを禁止するとか。多分。 コードとしてはメモリ内容と 1 をアトミックに交換し、0 が取得された場合は ロックが取れた (ロック変数を0から1に変更した) とみなし、 1 が取得された場合はロックが取れなかった (ロック変数は1から1のまま) とみなす、 というだけのことである。 ロックのキモはたったこれだけではある。 両方のスレッドからアクセス可能な 1 word 程度のメモリがあれば実現できる。 ただし、他がやばい。 // Acquire the lock.
// Loops (spins) until the lock is acquired.
void
acquire(struct spinlock *lk)
{ push_off(); // disable interrupts to avoid deadlock. if(holding(lk)) panic("acquire"); // On RISC-V, sync_lock_test_and_set turns into an atomic swap: // a5 = 1 // s1 = &lk->locked // amoswap.w.aq a5, a5, (s1) while(__sync_lock_test_and_set(&lk->locked, 1) != 0) ; // Tell the C compiler and the processor to not move loads or stores // past this point, to ensure that the critical section's memory // references happen strictly after the lock is acquired. // On RISC-V, this emits a fence instruction. __sync_synchronize(); // Record info about lock acquisition for holding() and debugging. lk->cpu = mycpu();
} // Release the lock.
void
release(struct spinlock *lk)
{ if(!holding(lk)) panic("release"); lk->cpu = 0; // Tell the C compiler and the CPU to not move loads or stores // past this point, to ensure that all the stores in the critical // section are visible to other CPUs before the lock is released, // and that loads in the critical section occur strictly before // the lock is released. // On RISC-V, this emits a fence instruction. __sync_synchronize(); // Release the lock, equivalent to lk->locked = 0. // This code doesn't use a C assignment, since the C standard // implies that an assignment might be implemented with // multiple store instructions. // On RISC-V, sync_lock_release turns into an atomic swap: // s1 = &lk->locked // amoswap.w zero, zero, (s1) __sync_lock_release(&lk->locked); pop_off();
} ロックを使わずアトミック命令でスレッドセーフに書く (ロックを作る時など) ための条件は以下の通り。 通常のメモリロードストア命令ではなくアトミック命令を使い、 途中の状態を他のコアから観測されないようにする。 コンパイラ最適化を無効にし、特定のラインをまたいだ命令の並べ替えを防止する。 メモリバリア命令を置き、それをまたいだ CPU 内での命令の並べ替えを防止する。 volatile の付与だけでは全然足りないことが分かる。 コンパイラによるコンパイル時の並べ替えと CPU による実行時の並べ替えは、 いつやるかが違うだけで概念としては同じものが使える。 メモリの読み書きの (物理的な) 順番の制御をメモリオーダリングと呼び、 手動でそれを防ぐ手段をメモリバリアと呼ぶ。 ちなみに x86 はメモリオーダリングに関してはかなり「堅い」方で、ARM はユルユルである。 Google が Android のために JVM を x86 から ARM に持っていったら 怪奇現象にしか見えないメモリオーダリングのバグに苦労したらしい…。

