スレッド間で通信をするためには、メモリ空間を共有していることを考えると、 共有メモリを読み書きするのが手軽である。 以下は shared_mem を 256 スレッドから 1000000 回インクリメントするが、 256000000 にはならない (ことがある)。 #include <stdio.h>
#include <pthread.h> void *proc(void *arg) { int *shared_mem = (int *)arg; for (int i = 0; i < 1000000; i++) { (*shared_mem)++; } return NULL;
} int main() { pthread_t th[256]; int shared_mem = 0; for (int i = 0; i < 256; i++) { if (pthread_create(&th[i], NULL, proc, &shared_mem) != 0) { fprintf(stderr, "Error creating thread\n"); return 1; } } for (int i = 0; i < 256; i++) { if (pthread_join(th[i], NULL) != 0) { fprintf(stderr, "Error joining thread\n"); return 1; } } printf("shared_mem = %d\n", shared_mem); return 0;
} このように何の工夫もなく複数のスレッドから共通のメモリを読み書きすると、色々と壊れる。 しかも確率的にごく稀に壊れることもある。 これを競合状態 (race condition)、スレッドセーフでない等という。 スレッドセーフでないコードが具体的にどうなるかは非常に説明が難しい。 当然ハードウェア実装にもよる。 昔ながらの教科書では以下のように説明されることが多いし、一旦はこれで納得すること。 でもこういうケースなら大丈夫じゃないの？と思ったりするが、全然大丈夫じゃないので その思考に至るレベルでは必ずロックを取ること。 スレッドAがメモリから値 0 を CPU 内に読む スレッドBがメモリから値 0 を CPU 内に読む スレッドAが CPU 内でインクリメントを行い、値 1 を CPU 内に用意する スレッドAがメモリへ値 1 を書き込む スレッドBが CPU 内でインクリメントを行い、値 1 を CPU 内に用意する スレッドBがメモリへ値 1 を書き込む まず、コンパイラの最適化がかかる。コンパイラ最適化はシングルスレッドでの実行結果が 変わらないことしか保証しない。 volatile int * とすると、1000000 回メモリに書き込む機械語が生成されることは 保証される。ただし volatile 単独ではスレッドセーフにはならない。 巷にはインチキコードが溢れているので注意。 高機能なプロセッサでは Out-of-Order 実行によって CPU の内部で機械語の実行順序を 並べ替えられる。こちらもシングルスレッドでの実行結果が変わらないことしか保証しない。 こんなとんでもないことをわざわざする理由については、CPU 設計のパイプラインと 命令間依存性、ハザードの話を参照。 ジムケラーを恨め。 パイプライン実行によって1命令を何クロックもかけて、他の命令と同時並列で実行する。 そのような CPU コアが複数あり、それぞれが同一クロックで独立して動いている。 この世の終わり。 Note: 読み出しのみならセーフ。 メモリに置いた定数を複数スレッドから共有するのは問題ない。
